Sr Prefecto mi aporte para la cultura de paz sería en lo siguiente: 
1) Hay q fomentar los valores desde los hogares, la familia es lo más importante de las personas;
2) fomentar en las escuelas y colegios este hábito para que desde allí crezca los cimientos de esta cultura ;
3)erradicar los estereotipos machistas o feministas;
4)propagar este cultura a través de la Tv ,prensa escrita ,prensa radial , redes sociales la cultura de paz 
5) también a través de charlas,talleres o seminarios
